message:
Avoid Jacoco deprecation warning

Eliminate build waring of Jacoco:

```
It is no longer possible to set the Jacoco version in the jacoco {}
block.
To update the version of Jacoco without updating the android plugin,
add a buildscript dependency on a newer version, for example:
buildscript{    dependencies {
        classpath "org.jacoco:org.jacoco.core:0.7.5.201505241946"    }}
```

Add alternate to Contributor name for anonymous contributos

GitHub API returns the following format of anonymous contributors;

  {
    "email": "EMAIL",
    "name": "NAME",
    "type": "Anonymous",
    "contributions": 2
  }

Since there is no "login" for anonymous contributors, add "name" as alternate of "login"
